INSERT INTO `article` (`id`, `idDomaine`, `sous_domaine`, `titre`, `texte`, `valide`, `date_modification`, `date_creation`) VALUES
(1, 1, 1, 'Poivron', '<h1>Quels sont les bienfaits des poivrons rouges ?</h1>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img alt=\"poivron en couleur\" src=\"img/article/poivron.jpg\" style=\"float:left; height:283px; width:200px\" />La vitamine C ayant des propri&eacute;t&eacute;s anti-oxydantes majeures, le <strong>poivron</strong> permet aussi de lutter efficacement contre les radicaux libres et le vieillissement pr&eacute;matur&eacute;, les maladies neuro-d&eacute;g&eacute;n&eacute;ratives, les pathologies cardiovasculaires, musculaires, articulaires.</p>\r\n', 1, '2023-01-02 16:13:42', '2023-01-02 13:54:05'),
(5, 1, 2, 'TodoList', '<ol>\r\n	<li><s>gestion des varietes : faire&nbsp; init html variete : si rowid alors charger la vari&eacute;t&eacute; sinon premier valeur (order by nom)</s></li>\r\n	<li>f<s>aire setlistSeed (category)&nbsp; list od seeds according to category</s></li>\r\n	<li><s>print principal information by php and by javascript onchange</s></li>\r\n	<li><s>add Drop-down menu with Jquerry</s></li>\r\n	<li><s>plateforme de dev</s></li>\r\n	<li>&agrave; tester class CSeedAction table des constants : si ca marche l&#39;&eacute;tendre aux autre table.</li>\r\n	<li>synchoniser les constants avec JS</li>\r\n	<li>show hide : variet&eacute; modification</li>\r\n	<li>add burger menu with jquery</li>\r\n	<li>Jquerry + ajax pour save variete</li>\r\n	<li>&nbsp;BUG ; liste des graines &agrave; trier par ordre alpha du nom</li>\r\n	<li>CAdmin&nbsp; : onclick utiliser AJax ? ok (genererConstant.php) a g&eacute;n&eacute;raliser</li>\r\n	<li>check app.js pour tous les constants utilist&eacute;</li>\r\n</ol>\r\n', 1, '2023-01-20 21:26:01', '2023-01-02 14:04:41'),
(6, 1, 1, 'persil ', '<p><img alt=\"\" src=\"img/article/persil.jpg\" style=\"float:left; height:186px; width:129px\" />Le persil est une esp&egrave;ce de plante herbac&eacute;e de la famille des Apiac&eacute;es et du genre Petroselinum. Le persil est couramment utilis&eacute; en cuisine pour ses feuilles tr&egrave;s divis&eacute;es, et en Europe centrale pour sa racine pivot. C&#39;est &eacute;galement une plante m&eacute;dicinale. Nom scientifique : Petroselinum crispum Fuss.</p>\r\n', 1, '2023-01-02 16:14:11', '2023-01-02 14:18:17'),
(11, 1, 2, 'Macro-fonction', '<h1>Macro fonction</h1>\r\n\r\n<ul>\r\n	<li>Finalit&eacute; 1 : G&eacute;n&eacute;rer la liste des t&acirc;ches hebdomadaires\r\n	<ul>\r\n		<li>Quoi planter et combien :&nbsp; Lister des besoins en r&eacute;colte</li>\r\n		<li>Quand planter&nbsp; : Cr&eacute;er un itin&eacute;raire de culture</li>\r\n		<li>ou planter : Cr&eacute;er 1 jardin -&gt; Puis Cr&eacute;er les planches de culture</li>\r\n	</ul>\r\n	</li>\r\n	<li>Finalit&eacute; 2 :&nbsp; G&eacute;rer des graines insert / update / delete</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n', 1, '2023-01-18 18:21:46', '2023-01-18 17:40:00');
